import styled from 'styled-components'
import {MAIN_COLOR, SECOND_COLOR} from '../../constants/styleConstants'

export const StyledNavbar = styled.nav`
    background-color:${MAIN_COLOR};
    border-bottom:5px solid ${SECOND_COLOR};
`
